import React from 'react';
import './App.css';
import SignUp from './components/SignUp'; // Assuming SignUp.js is in the same directory

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Employee Management App</h1>
      </header>
      <main>
        <SignUp />
      </main>
    </div>
  );
}

export default App;
